import React from 'react'

export default function Users({users}) {
    console.log(users);
    return (
        <div>
        {users?(
        <div>
            {users.map((user) => {<p key={user.id}>{user.name}</p>})}
        </div>

        ):
        null}
        </div>
    )
}
